import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import AdminDashboard from './admin/pages/AdminDashboard'; // تأكد من المسار الصحيح
import LoginPage from './admin/pages/LoginPage'; // تأكد من المسار الصحيح
import StudentDashboard from './student/pages/StudentDashboard'; // تأكد من المسار الصحيح
import { isAuthenticated } from './auth'; // تأكد من أن دالة isAuthenticated موجودة في هذا المسار

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          {/* صفحة تسجيل الدخول */}
          <Route path="/" element={<LoginPage />} />

          {/* التوجيه إلى لوحة التحكم للمسؤول إذا تم التوثيق */}
          <Route
            path="/admin-dashboard"
            element={isAuthenticated() ? <AdminDashboard /> : <LoginPage />}
          />

          {/* التوجيه إلى لوحة التحكم للطالب إذا تم التوثيق */}
          <Route
            path="/student-dashboard"
            element={isAuthenticated() ? <StudentDashboard /> : <LoginPage />}
          />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
